import Cards from "../Cards/Cards";
import { userSelector } from "react-redux";

const users = userSelector((state) => state.users);

const CardsContainers = () => {
  return (
    <>
      <h1>soy CardsContainers</h1>
      {users.map(() => {
        return <Cards />;
      })}
    </>
  );
};

export default CardsContainers;
